#   ELASTIC ANISOTROPIC SCATTERING IS IN DATA BASE . IF THERE IS NO
#   DATA ON ANISOTROPIC SCATTERING OF THE INELASTIC LEVELS THE def 
#   ESTIMATES THE ANISOTROPIC INELASTIC SCATTERING FROM THE ELASTIC 
