import numpy
from Setup import *
import sys
def DEGRADE():
	# IMPLICIT #real*8 (A-H,O-Z)
	# IMPLICIT #integer*8 (I-N)
	global TMAX,SMALL,API,ESTART,THETA,PHI
	global TCFMAX #array size 10
	global TCFMAX1,RSTART,EFIELD,ETHRM,ECUT,NEVENT,IMIP,IWRITE,EOVB,WB,BTHETA,BMAG
	LAST=0
	LAST=SETUP(LAST)
	if(LAST == 1):
		sys.exit()
	DENSITY()
	CASCDAT()
	MIXERC()
	MIXER()
	# CALCULATE FLUORESCENCE ABSORPTION DISTANCES 
	FLDIST()
	PRINTER()
	if(IMIP == 1):
		MIPCALC()
	# if MIP OR ELECTRON BEAM SKIP DIRECT CASCADE CALCULATION
	if(IMIP <= 2):
		PASSING	
	else:
		ICON=IMIP-2
		#  ICON=1 XRAY,   ICON=2 BETA DECAY , ICON=3 DOUBLE BETA DECAY  
		CONTROL0(NEVENT,ESTART,ICON)
		# CALCULATE AND OUTPUT AVERAGES FROM SHELLS
		OUTPUTC(NEVENT,IMIP)
		# AFTER ALL SHELL EMISSIONS THERMALISE ELECTRONS
	if(BMAG == 0.00):
		MONTEFE()
	if(BMAG != 0.00):
		if(BTHETA == 0.00 or BTHETA == 180.00):
			MONTEFA()
		elif(BTHETA == 90.00) :
			MONTEFB()
		else:
			MONTEFC()
		# endif
	# endif
	STATS2()
	OUTPUT()
	DEGRADE()
	sys.exit()
    # end
def ANGCUT(PSCT1,ANGC,PSCT2):
	# IMPLICIT #real*8 (A-H,O-Z)
	# IMPLICIT #integer*8 (I-N)
	#  --------------------------------------------------------------      
	#  SET ANGLE CUTS ON ANGULAR DISTRIBUTION AND RENORMALISE FORWARD 
	#  SCATTERING PROBABILITY  
	#  ---------------------------------------------------------------
	ANGC=1.0
	PSCT2=PSCT1         
	if(PSCT1 <= 1.0):
		return
	API=numpy.arccos(-1.00)
	RADS=2.0/API 
	CNS=PSCT1-0.5     
	THETAC=numpy.arcsin(2.0*math.sqrt(CNS-CNS*CNS))
	FAC=(1.0-numpy.cos(THETAC))/(numpy.sin(THETAC)*numpy.sin(THETAC))
	PSCT2=(CNS*FAC)+0.5      
	ANGC=THETAC*RADS
	return
	# end                                                              
