	# def CALLS UP TO 5 POSSIBLE MODELS OF ENERGY SPLITTING IN
	# IONISATION COLLISIONS 
	# CALLS def WITH ARRAY POSITION I , INCIDENT ENERGY E , 
	# AND IONISATION ENERGY LOSS EI, : OUTPUTS SECONDARY ENERGY ESEC
	if(IONMODEL[I]== 1) :
		SPLIT1(I,E,EI,ESEC)
	elif(IONMODEL[I] == 2) :
		SPLIT2(I,E,EI,ESEC)
